import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import HomePage from "./pages/HomePage/HomePage";
import MatchPage from "./pages/MatchPage/MatchPage";
import Tournament from "./pages/Tournament/Tournament";
import Tournament_id from "./pages/Tournament_id/Tournament_id";
import WebPage from "./pages/WebPage/WebPage";


function App() {
  return (
  <Router>
    <Routes>
      <Route path="/" element={<WebPage page={<HomePage/>}/>} />
      <Route path="/tournament" element={<Tournament/>} />
      <Route path="/tournament/:id" element={<Tournament_id/>} />

      <Route path="/match/:m_id" element={<WebPage page={<MatchPage/>}/>}  />
      <Route path="/match/:m_id/:inn_no/:graphic" element={<WebPage page={<MatchPage/>}/>}  />
    </Routes>
  </Router>
  );
}

export default App;
